/**
 * Reads the Figure from a StorableInput.
 */
public void read(StorableInput dr) throws IOException {
    super.read(dr);
    String s = dr.readString();
    if (s.toLowerCase().equals("attributes")) {
        fAttributes = new FigureAttributes();
        fAttributes.read(dr);
    }
}
